<script>
export default {
  name: 'PresignedURLView'
};
</script>

<script setup>
import { reactive, ref, computed } from 'vue';
import API from '@/utils/API.js';
import dayjs from 'dayjs';
import duration from 'dayjs/plugin/duration';
import Cookies from 'js-cookie';
import { Form } from 'ant-design-vue';
import Uploader from '@/components/Uploader.vue';

dayjs.extend(duration);

const formState = reactive({
  email: 'webcamp@gmail.com',
  password: 'webcamp12345678'
});
const rulesRef = reactive({
  email: [
    {
      required: true,
      message: 'Please input your username!'
    }
  ],
  password: [
    {
      required: true,
      message: 'Please input your password!'
    }
  ]
});

const useForm = Form.useForm;
const { resetFields, validate, validateInfos } = useForm(formState, rulesRef, {
  // onValidate: (...args) => console.log(...args)
});

const onFinish = () => {
  validate()
    .then(async () => {
      const {
        data: { access_token, token_expired }
      } = await API.POST('user/signin', {
        ...formState,
        provider: 'native'
      });

      const daysToExpire = dayjs.duration(token_expired, 'seconds').asDays();

      Cookies.set('PlatingToken', access_token, { expires: daysToExpire });

      resetFields();
    })
    .catch(err => {
      console.log('Failed:', err.message);
    });
};

const fileList = ref([
  {
    uid: 'vc-upload-1679303062780-2',
    lastModified: 1540789767000,
    lastModifiedDate: '2018-10-29T05:09:27.000Z',
    name: 'AN5A8818.JPG',
    size: 5502151,
    type: 'image/jpeg',
    percent: 0,
    originFileObj: '[object File]',
    thumbUrl:
      'data:image/png;base64,'
  }
]);

const isWorksheetComplete = ref(false);
const isUploaderDisable = computed(() => {
  if (fileList.value.length >= 6) {
    return true;
  } else {
    return false;
  }
});

function updateFileList(value) {
  fileList.value = [...value];
}
</script>

<template>
  <section class="w-1/2 mx-auto">
    <AForm
      :model="formState"
      name="basic"
      :labelCol="{ span: 8 }"
      :wrapperCol="{ span: 16 }"
      autocomplete="off"
    >
      <AFormItem label="Email" v-bind="validateInfos.email">
        <AInput v-model:value="formState.email" />
      </AFormItem>

      <AFormItem label="Password" v-bind="validateInfos.password">
        <AInputPassword v-model:value="formState.password" />
      </AFormItem>

      <AFormItem :wrapperCol="{ offset: 8, span: 16 }">
        <AButton type="primary" htmlType="submit" @click.prevent="onFinish"
          >Submit</AButton
        >
      </AFormItem>
    </AForm>
  </section>
  <section>
    <div class="flex flex-column">
      <Uploader
        :isUploaderDisable="isUploaderDisable"
        :fileList="fileList"
        :isWorksheetComplete="isWorksheetComplete"
        @updateFileList="updateFileList"
      />
    </div>
  </section>
  <AButton @click="isWorksheetComplete = !isWorksheetComplete"
    >已覆核完成</AButton
  >
</template>

<style scoped></style>
